import React from 'react'
import styled from 'styled-components';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import test from '../Images/pizza.jpg'
import { Button } from './Button';

const CardWrapper =styled.div``;
const Card=styled.div``;
function ProductsSliderMenue() {
    var settings = {
        dot:true,
        infinite:true,
        speed:500,
        slidesToShow:3,
        slidesToScroll:1,
        cssEase:"linear"
    }
    return (
      <Slider {...settings}>
          <CardWrapper>
              <Card>
                  <img src={test}></img>
              </Card>
              <Button to = '/goToMenue' primary = 'true'></Button>
          </CardWrapper>
      </Slider>
    )
}

export default ProductsSliderMenue
